class Solution(object):
    def repeatedSubstringPattern(self, str):
        """
        :type str: str
        :rtype: bool
        """
        l = len(str)
        c=0
        sl = 0
        ret = False
        for j in xrange(1,len(str)/2+1):
            substr = str[0:j]
            substr2 = str[j+1:]
            sl = len(substr)
            c = str.count(substr)
            if c*sl == l:
                ret = True 
                break
            elif c < 2 :
                break
            elif sl > l/c:
                break
        return ret
            
        
    
